import React from 'react';
import { Grid, Typography } from '@material-ui/core';

const Footer = () => {
    return (
        <div style={{ backgroundColor: '#f4f5f7' }}>
            <div className="mycontainer">
                
                <Grid container sm={12}>
                    
                </Grid>

            </div>
        </div>
    )
}

export default Footer;
